import React, { useEffect, useState } from 'react';
import './Dashboard.css';
// ‡πÄ‡∏û‡∏¥‡πà‡∏°‡∏™‡πÑ‡∏ï‡∏•‡πå‡∏ò‡∏µ‡∏°‡∏°‡πà‡∏ß‡∏á‡πÅ‡∏ö‡∏ö‡∏´‡∏ô‡πâ‡∏≤ trainee
const themePurple = {
  background: 'linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%)',
  minHeight: '100vh',
  fontFamily: 'Inter, sans-serif',
};

const TrainerDashboard = () => {
  // Removed videos, summary, and traineeReport state as requested
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState('');
  const [profile, setProfile] = useState({ name: '', email: '', picture: '' });

  useEffect(() => {
    const token = localStorage.getItem('token');
    setIsLoading(true);
    fetch('http://localhost:8000/me', {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => res.json())
      .then(profileData => {
        if (profileData && profileData.name) {
          let pictureUrl = profileData.picture;
          if (!pictureUrl || typeof pictureUrl !== 'string' || pictureUrl.startsWith('http') === false) {
            pictureUrl = '/user (1).png';
          }
          setProfile({
            name: profileData.name,
            email: profileData.email,
            picture: pictureUrl
          });
        }
      })
      .catch(err => setError('‡πÄ‡∏Å‡∏¥‡∏î‡∏Ç‡πâ‡∏≠‡∏ú‡∏¥‡∏î‡∏û‡∏•‡∏≤‡∏î‡πÉ‡∏ô‡∏Å‡∏≤‡∏£‡πÇ‡∏´‡∏•‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•'))
      .finally(() => setIsLoading(false));
  }, []);

  if (isLoading) return <div className="dashboard-loading"><div className="loading-spinner"></div><p>‡∏Å‡∏≥‡∏•‡∏±‡∏á‡πÇ‡∏´‡∏•‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•...</p></div>;
  if (error) return <div className="error-message">{error}</div>;

  // ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô logout
  const handleLogout = () => {
    localStorage.removeItem('user');
    localStorage.removeItem('token');
    window.location.href = '/login';
  };

  return (
    <div className="dashboard trainer-dashboard-bg" style={themePurple}>
      {/* Header */}
      <nav className="dashboard-nav">
        <div className="dashboard-logo">FitAddict</div>
        <div className="dashboard-user">
          <img src={profile.picture} alt="avatar" className="user-avatar" style={{width: 40, height: 40, borderRadius: '50%', objectFit: 'cover', background: '#ede9fe'}} onError={e => { e.target.onerror = null; e.target.src = '/user (1).png'; }} />
          <span className="user-name" style={{ fontWeight: 700, fontSize: "1.1rem", color: "#1e293b" }}>{profile.name}</span>
          <button className="logout-btn" style={{ marginLeft: "1.5rem", background: "#f1f5f9", color: "#64748b", fontWeight: 500, border: "none", borderRadius: "100px", padding: "0.5rem 1.25rem", cursor: "pointer", fontSize: "0.95rem", transition: "all 0.3s" }} onClick={handleLogout}>‡∏≠‡∏≠‡∏Å‡∏à‡∏≤‡∏Å‡∏£‡∏∞‡∏ö‡∏ö</button>
        </div>
      </nav>

      {/* Welcome Section */}
      <main className="dashboard-main">
        <div className="dashboard-welcome">
          <h1>‡∏¢‡∏¥‡∏ô‡∏î‡∏µ‡∏ï‡πâ‡∏≠‡∏ô‡∏£‡∏±‡∏ö, {profile.name}!</h1>
          <p>‡∏ô‡∏µ‡πà‡∏Ñ‡∏∑‡∏≠‡∏´‡∏ô‡πâ‡∏≤‡∏™‡∏≥‡∏´‡∏£‡∏±‡∏ö Trainer ‡∏Ñ‡∏∏‡∏ì‡∏™‡∏≤‡∏°‡∏≤‡∏£‡∏ñ‡∏î‡∏π‡∏™‡∏£‡∏∏‡∏õ‡πÅ‡∏•‡∏∞‡∏à‡∏±‡∏î‡∏Å‡∏≤‡∏£‡∏£‡∏∞‡∏ö‡∏ö‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì‡πÑ‡∏î‡πâ‡∏ó‡∏µ‡πà‡∏ô‡∏µ‡πà</p>
        </div>

        {/* Card Section (removed video and trainee-report cards as requested) */}
        <div className="dashboard-stats">
          <div className="stat-card">
            <h3>
              <span className="material-icons">person_add</span>
              Invite Trainee
            </h3>
            <p>‡πÄ‡∏ä‡∏¥‡∏ç‡∏ú‡∏π‡πâ‡πÉ‡∏ä‡πâ‡πÉ‡∏´‡∏°‡πà‡πÄ‡∏Ç‡πâ‡∏≤‡∏£‡∏∞‡∏ö‡∏ö‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì</p>
            <button className="action-btn">‡πÄ‡∏ä‡∏¥‡∏ç‡∏ú‡∏π‡πâ‡πÉ‡∏ä‡πâ</button>
          </div>
          <div className="stat-card">
            <h3>
              <span className="material-icons">groups</span>
              Trainee
            </h3>
            <p>‡∏î‡∏π‡∏£‡∏≤‡∏¢‡∏á‡∏≤‡∏ô‡∏ú‡∏π‡πâ‡πÄ‡∏Ç‡πâ‡∏≤‡∏≠‡∏ö‡∏£‡∏°‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì</p>
            <button className="action-btn">‡∏î‡∏π‡∏£‡∏≤‡∏¢‡∏á‡∏≤‡∏ô‡∏ú‡∏π‡πâ‡πÄ‡∏Ç‡πâ‡∏≤‡∏≠‡∏ö‡∏£‡∏°</button>
          </div>
        </div>

        {/* Dashboard analytics and trainee report sections (‡∏Ñ‡∏á‡πÇ‡∏Ñ‡πâ‡∏î‡πÄ‡∏î‡∏¥‡∏°‡πÑ‡∏ß‡πâ) */}
      </main>

  {/* Card Section ‡∏ñ‡∏π‡∏Å‡∏•‡∏ö‡∏ï‡∏≤‡∏°‡∏Ñ‡∏≥‡∏Ç‡∏≠ */}

      {/* Dashboard analytics and trainee report sections */}
      <>
        {/* Row 1: Video + Analytics */}
        <section className="trainer-section" style={{marginBottom: '2.5rem'}}>
          <div className="dashboard-row" style={{display: 'flex', justifyContent: 'center', alignItems: 'flex-start', gap: '1.5rem', maxWidth: 1100, margin: '0 auto'}}>
            {/* Video card */}
            {videos.length === 0 ? (
              <div className="stat-card" style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì (‡∏£‡∏≤‡∏¢‡∏•‡∏∞‡πÄ‡∏≠‡∏µ‡∏¢‡∏î)</h2>
                <h3 style={{color: '#7c3aed', fontWeight: 700}}>‡∏ï‡∏±‡∏ß‡∏≠‡∏¢‡πà‡∏≤‡∏á‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠</h3>
                <div style={{display: 'flex', alignItems: 'center', gap: '0.5rem'}}>
                  <p style={{color: '#64748b', marginBottom: 0}}>‡∏ñ‡∏π‡∏Å‡πÉ‡∏ä‡πâ 12 ‡∏Ñ‡∏£‡∏±‡πâ‡∏á</p>
                  <span className="popular-badge" style={{background: 'linear-gradient(90deg,#a855f7,#6366f1)', color: 'white', padding: '0.25rem 0.75rem', borderRadius: 12, fontWeight: 600, fontSize: '0.95rem'}}>üî• Popular</span>
                </div>
              </div>
            ) : (
              videos.map(v => (
                <div className="stat-card video-card" key={v.id} style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì (‡∏£‡∏≤‡∏¢‡∏•‡∏∞‡πÄ‡∏≠‡∏µ‡∏¢‡∏î)</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>{v.title}</h3>
                  <p style={{color: '#64748b'}}>‡∏ñ‡∏π‡∏Å‡πÉ‡∏ä‡πâ {v.usage_count} ‡∏Ñ‡∏£‡∏±‡πâ‡∏á</p>
                  {v.is_popular && <span className="popular-badge" style={{background: 'linear-gradient(90deg,#a855f7,#6366f1)', color: 'white', padding: '0.25rem 0.75rem', borderRadius: 12, fontWeight: 600, fontSize: '0.95rem'}}>üî• Popular</span>}
                </div>
              ))
            )}
            {/* Analytics cards */}
            {summary ? (
              <>
                <div className="stat-card" style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>‡∏™‡∏£‡∏∏‡∏õ‡∏Å‡∏≤‡∏£‡πÉ‡∏ä‡πâ‡∏á‡∏≤‡∏ô‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏ó‡∏µ‡πà‡∏ñ‡∏π‡∏Å‡πÉ‡∏ä‡πâ‡∏°‡∏≤‡∏Å‡∏ó‡∏µ‡πà‡∏™‡∏∏‡∏î</h3>
                  <p style={{color: '#64748b'}}>{summary.most_popular_title} ({summary.most_popular_count} ‡∏Ñ‡∏£‡∏±‡πâ‡∏á)</p>
                </div>
                <div className="stat-card" style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>‡∏™‡∏£‡∏∏‡∏õ‡∏Å‡∏≤‡∏£‡πÉ‡∏ä‡πâ‡∏á‡∏≤‡∏ô‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>‡∏à‡∏≥‡∏ô‡∏ß‡∏ô‡∏Å‡∏≤‡∏£‡πÉ‡∏ä‡πâ‡∏á‡∏≤‡∏ô‡∏£‡∏ß‡∏°</h3>
                  <p style={{color: '#64748b'}}>{summary.total_usage} ‡∏Ñ‡∏£‡∏±‡πâ‡∏á</p>
                </div>
              </>
            ) : (
              <>
                <div className="stat-card" style={{minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>‡∏™‡∏£‡∏∏‡∏õ‡∏Å‡∏≤‡∏£‡πÉ‡∏ä‡πâ‡∏á‡∏≤‡∏ô‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏ó‡∏µ‡πà‡∏ñ‡∏π‡∏Å‡πÉ‡∏ä‡πâ‡∏°‡∏≤‡∏Å‡∏ó‡∏µ‡πà‡∏™‡∏∏‡∏î</h3>
                  <p style={{color: '#64748b'}}>‡∏ï‡∏±‡∏ß‡∏≠‡∏¢‡πà‡∏≤‡∏á‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠ (8 ‡∏Ñ‡∏£‡∏±‡πâ‡∏á)</p>
                </div>
                <div className="stat-card" style={{minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>‡∏™‡∏£‡∏∏‡∏õ‡∏Å‡∏≤‡∏£‡πÉ‡∏ä‡πâ‡∏á‡∏≤‡∏ô‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>‡∏à‡∏≥‡∏ô‡∏ß‡∏ô‡∏Å‡∏≤‡∏£‡πÉ‡∏ä‡πâ‡∏á‡∏≤‡∏ô‡∏£‡∏ß‡∏°</h3>
                  <p style={{color: '#64748b'}}>20 ‡∏Ñ‡∏£‡∏±‡πâ‡∏á</p>
                </div>
              </>
            )}
          </div>
        </section>
        {/* Row 2: Trainee report full width */}
        <section className="trainer-section">
          <div className="trainer-card-list" style={{display: 'flex', justifyContent: 'center', alignItems: 'flex-start', gap: '1.5rem', flexWrap: 'wrap', maxWidth: 1100, margin: '0 auto'}}>
